import React, { useContext } from "react";
import { DarkModeContext } from "./DarkModeContext";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import AnimatedBackground from "./AnimatedBackground"; 
import TypingEffect from "react-typing-effect";
import { FaGithub, FaLinkedin, FaTwitter } from "react-icons/fa";

const Hero = () => {
  const { isDarkMode } = useContext(DarkModeContext);

  // Carousel settings
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <section
      id="home"
      className={`min-h-screen flex items-center justify-center relative overflow-hidden ${
        isDarkMode
          ? "bg-gradient-to-br from-[#0a0a1a] via-[#1a1a2e] to-[#0a0a1a]"
          : "bg-gradient-to-r from-blue-50 to-purple-50"
      }`}
    >
      <div className="container mx-auto px-4 py-20">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
          <div className="space-y-6" data-aos="fade-right">
            <div className="space-y-2">
              <h1 className={`text-4xl font-bold ${isDarkMode ? "text-purple-400" : "text-blue-600"}`}>
                &lt;Hello World /&gt;
              </h1>
              <h2 className={`text-5xl font-bold ${isDarkMode ? "text-white" : "text-gray-800"}`}>
                I'm <span className={`${isDarkMode ? "text-purple-400" : "text-blue-600"}`}>Rohann</span>
              </h2>
            </div>

            <div className="flex items-center space-x-2">
              <div className={`w-3 h-3 rounded-full ${isDarkMode ? "bg-purple-400" : "bg-blue-600"}`} />
              <p className={`text-xl ${isDarkMode ? "text-gray-300" : "text-gray-600"}`}>
                Full Stack Developer
              </p>
            </div>

            <p className={`text-lg ${isDarkMode ? "text-gray-400" : "text-gray-600"}`}>
              Passionate about creating innovative solutions using cutting-edge technologies.
              Specialized in AI/ML, Full Stack Development, and Cloud Computing.
            </p>

            <div className="flex space-x-4">
              <a
                href="https://github.com/yourusername"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-3 rounded-full ${
                  isDarkMode
                    ? "bg-[#2a2a3e] text-purple-400 hover:bg-[#3a3a4e]"
                    : "bg-blue-100 text-blue-600 hover:bg-blue-200"
                } transition-colors`}
              >
                <FaGithub className="text-xl" />
              </a>
              <a
                href="https://linkedin.com/in/yourusername"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-3 rounded-full ${
                  isDarkMode
                    ? "bg-[#2a2a3e] text-purple-400 hover:bg-[#3a3a4e]"
                    : "bg-blue-100 text-blue-600 hover:bg-blue-200"
                } transition-colors`}
              >
                <FaLinkedin className="text-xl" />
              </a>
              <a
                href="https://twitter.com/yourusername"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-3 rounded-full ${
                  isDarkMode
                    ? "bg-[#2a2a3e] text-purple-400 hover:bg-[#3a3a4e]"
                    : "bg-blue-100 text-blue-600 hover:bg-blue-200"
                } transition-colors`}
              >
                <FaTwitter className="text-xl" />
              </a>
            </div>

            <div className={`p-4 rounded-lg ${isDarkMode ? "bg-[#2a2a3e]" : "bg-blue-50"}`}>
              <p className={`font-mono ${isDarkMode ? "text-purple-400" : "text-blue-600"}`}>
                <span className="text-gray-500">const</span> skills = [<br />
                &nbsp;&nbsp;<span className="text-purple-400">"AI/ML"</span>,<br />
                &nbsp;&nbsp;<span className="text-purple-400">"Full Stack"</span>,<br />
                &nbsp;&nbsp;<span className="text-purple-400">"Cloud Computing"</span><br />
                ];
              </p>
            </div>
          </div>

          <div className="relative" data-aos="fade-left">
            <div className={`absolute inset-0 bg-gradient-to-r from-purple-500/20 to-blue-500/20 rounded-full blur-3xl`} />
            <img
              src="https://images.unsplash.com/photo-1507238691740-187a5b1d37b8?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3"
              alt="Profile"
              className="relative rounded-full w-80 h-80 object-cover mx-auto"
            />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
